Enjoy getting a daily horoscope and playing your favorite type of solitaire game all in one with this fascinating and relaxing pastime. In Fortune mode, play three creative layouts and reveal your luck. In Fame mode, escape the daily noise by solving more than 600 calm and serene layouts.

Hours upon hours of tile-matching relaxation await you in this beautifully crafted mahjong game. Select from 40 tile sets, symbols, backgrounds, music, and more on your way to finding your fortune. What will the tiles reveal?
